import React, { Component } from 'react'

import PokemonCard from './PokemonCard';

export default class PokemonList extends Component {
  state() {}
  render() {
    return (
      <div className="row">
        <PokemonCard/>
        <PokemonCard/>
        <PokemonCard/>
        <PokemonCard/>
        <PokemonCard/>
        <PokemonCard/>
        <PokemonCard/>
      </div>
    )
  }
}
